(67, 43, '_et_pb_old_content', '<div id="faq-container">[su_spoiler title=" How much milk can I pack in each shipping container?" anchor="Spoiler-1"] The shipping container is intended to handle approximately one day’s production of breast milk up to 34 oz. (1 liter). [/su_spoiler]\r\n[su_spoiler title="How do I track my shipment?" anchor="Spoiler-2"] The best way to track your shipment is via the USPS Mobile app for iPhone or Android. Download the app and use the “SCAN” function to scan the tracking number bar code on the shipping container label, then use the app''s tracking function periodically to check status. [/su_spoiler]\r\n[su_spoiler title="How can I assure that my milk is fully refrigerated when packing?" anchor="Spoiler-3"] All of your breast milk must be fully refrigerated prior to packing the Milk Stork shipping box. Depending on the temperature of the refrigerator you are using, this could take approximately 1-2 hours.To ensure that the Milk Stork shipping box has reached the proper cooling temperature, we recommend activating the cooling unit and then closing the Milk Stork shipping box at least 1 hr. prior to packing. The cooling unit is at the proper temperature when the Nanocool logo appears in blue under the activation button.\r\n\r\n[/su_spoiler]\r\n\r\n[su_spoiler title="What should my baby''s caregiver do upon receiving a Milk Stork delivery?" anchor="Spoiler-4"] There are instructions to the caregiver on the packing label that you affix to the top of the cooling unit. To ensure proper breast milk storage procedures, it is critical that this label be filled out completely prior to closing, sealing and shipping the Milk Stork box.\r\n\r\nUpon opening the shipping container your caregiver should record the exact date and time the container was opened and the breast milk unpacked. The milk storage bags should be immediately transferred from the refrigerated shipping container to a refrigerator. From there you can treat it just like any breast milk that has been refrigerated for a couple of days.\r\n\r\n<b><i>Please note</i></b>: It is your responsibility to test the temperature of the breast milk to ensure that it meets your standards for refrigerated storage. Your caregiver can use a digital thermometer to determine the temperature of the delivery by testing one breast milk storage bags upon opening the box and prior to transferring contents to the refrigerator. Because ambient temperature and handling of the storage bags will cause the temperature of the breast milk to rise, we recommend that the temperature be taken immediately after the package is opened.\r\n\r\n[/su_spoiler]\r\n\r\n[su_spoiler title="Where is my Milk Stork shipment? There wasn''t a Milk Stork package at my hotel/destination." anchor="Spoiler-5"] Use the tracking number provided in your welcome email with the USPS Mobile app to determine the status of your shipment. If there is an issue with the estimated delivery time, please <a href="#">click here</a> for assistance. [/su_spoiler]\r\n\r\n[su_spoiler title="Where is my breast milk? My Milk Stork delivery didn''t arrive home the next day." anchor="Spoiler-6"] Use the USPS Mobile app to check the shipping status and estimated delivery information. The Milk Stork refrigerated shipping box will remain effective into the evening of the next day. [/su_spoiler]\r\n\r\n[su_spoiler title="My Milk Stork delivery missed the pickup window at reception." anchor="Spoiler-7"] Confirm USPS pick up times and protocols with the hotel. Alternatively, you can use the USPS Mobile app to find the locations of nearby Post Offices and respective drop off deadlines.\r\n\r\nAlso, any Staples can handle packages received before 4:00 PM local time.\r\n\r\nFinally, your business destination may be able help you.\r\n\r\n[/su_spoiler]\r\n\r\n[su_spoiler title="Will my company reimburse the cost of my Milk Stork deliveries?" anchor="Spoiler-8"]\r\nMany breast feeding-supportive companies treat Milk Stork deliveries as a necessary travel expense. If this practice is not yet in place at your company, use this <a href="https://milkstork.com/reimbursement-request/" target="_blank">sample letter</a> to ask your company to support your commitment to breast feeding and to request reimbursement.[/su_spoiler]\r\n\r\n[su_spoiler title="My milk was spoiled on arrival – what do I do?" anchor="Spoiler-9"] Discard spoiled milk to ensure that it is not fed to your baby. Please <a href="#">click here</a> to request a refund [/su_spoiler]\r\n\r\n[su_spoiler title="How long will the shipping container keep my milk refrigerated?" anchor="Spoiler-10"] Refrigeration is effective for more than two and a half days. [/su_spoiler]\r\n\r\n[su_spoiler title="Can I recycle the shipping container? Can it be reused?" anchor="Spoiler-11"] The shipping container cannot be reused, but all of its components can be recycled. [/su_spoiler]\r\n\r\n</div>'),
