(225, 131, '_et_pb_old_content', 'In May 2014, I was preparing for a three day business trip. As a mom of exclusively breast milk fed, seven month old twins (and a rambunctious three year old), I was apprehensive about the trip. Even though I had created a stash of extra breast milk by adding pumping sessions to my busy schedule weeks ahead of time, I worried my babies would not have enough milk while I was away... and, I worried about maintaining my milk supply while I was gone... and, I worried about when and where I was going to pump during the trip... and, I worried about lugging two heavy, leaky gallons of breast milk home to my babies – keeping it cold on the plane, not to mention the hassle of getting it through TSA. But, most of all, I worried about being away from my kids.\r\n\r\nI considered not taking the trip. I considered giving the babies formula. I tried to figure out a way to ship the milk back home but it was too complicated. And while I didn’t consider weaning the babies early, I could understand why many working, breastfeeding moms make that difficult choice. There were no easy options for biz traveling, breastfeeding moms.\r\n\r\nThe day before I left for my trip was Mother’s Day—my day to celebrate my commitment to my kids. And, on that day that I decided I needed to find a way to make life a little bit easier for moms like me. That’s the day I came up with the idea for Milk Stork.\r\n\r\nStanding in the midst of our toy-strewn living room both of us with a baby in hand, I told my husband that I was going to start a company. After a high-five of support from him, I picked up my phone and called another amazing dad for help, my dad. Over the next nine months, we worked together to create Milk Stork from the ground up. I worked on Milk Stork every time I made my milk–during 20 minute pump sessions, five times a day, every day. Our hard work finally paid off, and we launched Milk Stork on March 2, 2015.\r\n\r\nToday, Milk Stork is the first and only company that provides no-fuss, overnight refrigerated shipping of breast milk from business traveling moms, to their babies back home. We know that the commitment to breastfeed is an adventure filled with many ups and downs, logistical challenges, and rewarding moments. It’s our hope that Milk Stork makes that adventure just a little bit easier.'),
