(735, 210, '_et_pb_old_content', '<p style="text-align: justify;">Milk Stork, Inc. (“Milk Stork,” “we,” “us,” or “our”) welcomes you.  We provide access to our website <a href="http://www.milkstork.com">www.milkstork.com</a> (“Website”) and our Services subject to the following “Terms of Use” which may be updated by us from time to time without notice to you.  By browsing the public areas of the Website or by accessing and using the Website platform (“Platform”) for our Services, you acknowledge that you have read, understood, and agree to be legally bound by these Terms of Use and the terms and conditions of our <a href="http://www.milkstork.com/privacypolicy">Privacy Policy</a>, which are hereby incorporated by reference (collectively, this “Agreement”).  THIS IS A BINDING LEGAL CONTRACT.  IF YOU DO NOT AGREE TO ANY OF THESE TERMS, PLEASE DO NOT USE THE WEBSITE OR PLATFORM.</p>\r\n<p style="text-align: justify;">Capitalized terms not defined in these Terms of Use shall have the meaning set forth in our Privacy Policy.</p>\r\n\r\n<ol style="text-align: justify;">\r\n	<li><strong><span style="text-decoration: underline;">DESCRIPTION AND USE OF THE WEBSITE AND PLATFORM</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">Milk Stork is a breast milk delivery service for breast-feeding moms who travel and are away from their babies. We provide packaging and delivery services that allow you to ship approximately one day’s supply of refrigerated breast milk from your travel destination to your baby for each day that you are away (the “Services”).</p>\r\n<p style="text-align: justify;">We provide you, either as a Visitor or User, with access to our Website and Platform as described in this Agreement.</p>\r\n<p style="padding-left: 30px; text-align: justify;">a. <span style="text-decoration: underline;">Visitors.</span>  “Visitors” do not register with us, but are able to view all publicly-accessible Content.</p>\r\n<p style="padding-left: 30px; text-align: justify;">b. <span style="text-decoration: underline;">Users.</span>  Registration and login is required for all Users.  In addition to viewing all publicly-accessible Content, “Users” can use our Platform to: (i) schedule Milk Stork deliveries; (ii) provide us feedback in our online forum (when available) and upload content, including text, videos, and photos (collectively, “User Content”); (iii) sign up for alerts, other notifications, and our newsletter; and (iv) sign up for our promotions. We are under no obligation to accept any individual as a User, and may accept or reject any registration in our sole and complete discretion.</p>\r\n\r\n<ol style="text-align: justify;" start="2">\r\n	<li><strong><span style="text-decoration: underline;">COMMUNITY GUIDELINES</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">Milk Stork’s community, like any community, functions best when its people follow a few simple rules.  By accessing the Website or the Platform and using our Services, you hereby agree to comply with the following limitations on your use:</p>\r\n\r\n<ul style="text-align: justify;">\r\n	<li>Users must be the age of majority in their jurisdiction and have the power to enter into binding contracts and not be not barred from doing so;</li>\r\n	<li>You will not use the Website or the Platform for any unlawful purpose;</li>\r\n	<li>Users may not use the Services to engage in any commercial activities, including, without limitation, raising money; advertising or promoting a product, service, or company; or engaging in any pyramid or other multi-tiered marketing scheme;</li>\r\n	<li>You will not upload, post, e-mail, transmit, or otherwise make available any User Content that:\r\n<ul style="list-style-type: circle;">\r\n	<li>is false, deceptive, misleading, deceitful, or misinformative;</li>\r\n	<li>infringes any copyright, trademark, trade secret, right of publicity, or other proprietary rights of any person or entity;</li>\r\n	<li>is threatening, tortious, defamatory, libelous, indecent, obscene,</li>\r\n	<li>pornographic, invasive of another’s privacy, or promotes violence; or</li>\r\n	<li>discloses any sensitive information about another person, including that person’s e-mail address, postal address, phone number, credit card information, or any similar information;</li>\r\n</ul>\r\n</li>\r\n	<li>You will not access or use the Website or the Platform to collect any market research for a competing business;</li>\r\n	<li>You will not impersonate any person or entity or falsely state or otherwise misrepresent your affiliation with a person or entity;</li>\r\n	<li>You will not take any action that imposes or may impose (in Milk Stork’s sole discretion) an unreasonable or disproportionately large load on our technical infrastructure;</li>\r\n	<li>You will not use automated means, including spiders, robots, crawlers, data mining tools, or the like to download or scrape data from the Website or Platform, except for Internet search engines (<em>g.</em>, Google) and non-commercial public archives (e.g., archive.org) that comply with our robots.txt file;</li>\r\n	<li>You will not cover, obscure, block, or in any way interfere with any advertisements and/or safety features (<em>g</em>., report abuse button) on the Website or the Platform;</li>\r\n	<li>You will not interfere with or attempt to interrupt the proper operation of the Website or the Platform through the use of any virus, device, information collection or transmission mechanism, software or routine, or access or attempt to gain access to any data, files, or passwords through hacking, password or data mining, or any other means;</li>\r\n	<li>You will not use the Website, Platform, or Services for the purpose of selling, swapping or donating your breast milk;</li>\r\n	<li>You will not identify an address for shipment other than one at which your child is located; and</li>\r\n	<li>You will only use the Website, Platform, and Services to provide milk for your own child and not for another child.</li>\r\n</ul>\r\n<p style="text-align: justify;">Please let us know about inappropriate content.  If you find something that violates our community guidelines or these Terms of Use, let us know at info@milkstork.com, and we’ll review it. We reserve the right, in our sole and absolute discretion, to deny you access to the Platform, the Website, or any portion of the Services, without notice, and remove any User Content that does not adhere to these Terms of Use or is otherwise unacceptable to us.</p>\r\n\r\n<ol style="text-align: justify;" start="3">\r\n	<li><strong><span style="text-decoration: underline;">REGISTRATION FOR USERS</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">During the registration process for Users, we will ask you to create an account, which will require the creation of a unique sign-in name (“Sign-In Name”) and password (“Password”), and may request certain additional information that will assist in authenticating your identity when you log-in in the future (“Unique Identifiers”).  When creating your account, you must provide true, accurate, current, and complete information.  Each Sign-In Name and corresponding Password can be used by only one User.  You are solely responsible for the confidentiality and use of your Sign-In Name, Password, and Unique Identifiers, as well as for any use, misuse, or communications entered through the Platform using one or more of them.  You will promptly inform us of any need to deactivate a Password or Sign-In Name, or change any Unique Identifier.  We reserve the right to delete or change your Password, Sign-In Name, or Unique Identifier at any time and for any reason.  Milk Stork will not be liable for any loss or damage caused by any unauthorized use of your account.</p>\r\n\r\n<ol style="text-align: justify;" start="4">\r\n	<li><strong><span style="text-decoration: underline;">PAYMENT</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">You agree that Milk Stork may immediately authorize your credit card (or other approved facility) for payment for any charges incurred under your account.</p>\r\n<p style="text-align: justify;">You are fully responsible for all activities that occur under your account, and you agree to be personally liable for all charges incurred under your account.  Your liability for such charges will continue after termination of this Agreement.</p>\r\n<p style="text-align: justify;">If you have a question about any Milk Stork charge on your credit card statement, please contact  us through our Website at <a href="http://www.milkstork.com/contactus">www.milkstork.com/contactus</a>.</p>\r\n\r\n<ol style="text-align: justify;" start="5">\r\n	<li><strong><span style="text-decoration: underline;">ORDERING AND DELIVERY</span></strong></li>\r\n</ol>\r\n<p style="padding-left: 30px; text-align: justify;">a. Milk Stork does not deliver to every location and does not deliver on Sundays. Please check our FAQ on the Website to see if our Services are available in your area.  If we currently do not deliver to your area, but you would like us to, please let us know at <a href="www.milkstork.com/contactus">www.milkstork.com/contactus</a>. We are expanding the reach of our Services, so we recommend that you provide your name, email address and zip code, and we will notify you when we launch in your zip code.</p>\r\n<p style="padding-left: 30px; text-align: justify;">b. When you sign up for Milk Stork Services, be aware that a cancellation request requires advanced notice to Milk Stork. If you wish to cancel your shipment, please log-in to your account, using your Sign-In Name and Password and follow the appropriate instructions, noting the applicable deadlines.  If you miss these deadlines, you will be responsible for paying the applicable cancellation charge.</p>\r\n<p style="padding-left: 30px; text-align: justify;">c.<strong> Maintaining a safe refrigerated temperature of your breast milk is essential. You acknowledge that you are responsible for ensuring that you (i) properly refrigerate your breast milk before packing and (ii) following all packing instructions</strong>.  Milk Stork uses reliable third-party delivery companies such as the United States Postal Service (“USPS”) to deliver your breast milk.  Each package (as described further below) is designed to keep your breast milk refrigerated for at least 48 hours from activation. To ensure the integrity of the breast milk after delivery, we recommend checking the breast milk with a thermometer to ensure the temperature meets your standards for refrigerated breast milk and immediately refrigerating the breast milk when received.   <strong><span style="text-decoration: underline;">You acknowledge that you and your caregivers are responsible for conducting your own due diligence to determine your standards for milk temperature.</span></strong>  <strong>While we do not make any representations or warranties regarding the accuracy of completeness of this advice</strong>, we suggest the following resources: the United States Government’s <a href="http://www.cdc.gov/breastfeeding/recommendations/handling_breastmilk.htm">recommendations provided by the Centers for Disease Control and Prevention</a> and the <a href="http://www.breastfeedingnetwork.org.uk/breastfeeding-help/expressing-storing">Breastfeeding Network’s recommendations</a>, which is an independent breastfeeding support and information resource for breastfeeding mothers and others.</p>\r\n<p style="padding-left: 30px; text-align: justify;">d. If you are not home when a delivery arrives, USPS will leave the package for you at your door.  It is your responsibility to coordinate delivery time with the caregiver to ensure proper temperature and storage conditions. Milk Stork is not responsible for any delays, lost packages, or other outside events that may affect delivery.</p>\r\n\r\n<ol style="text-align: justify;" start="6">\r\n	<li><strong><span style="text-decoration: underline;">PACKAGING</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">As part of our Services, we provide you with the supplies that you will need to package your breast milk and prepare it for delivery.  <strong>You acknowledge that it is your responsibility to carefully read and view all packing instructions provided by Milk Stork</strong>.</p>\r\n<p style="padding-left: 30px; text-align: justify;">a. We provide 6 NUK breast milk storage bags. Each bag can hold up to 6 ounces of breast milk.  No more than 34 ounces may be packed into a NanoCool refrigeration unit in one shipment (which is slightly less than 6 full NUK bags).</p>\r\n<p style="padding-left: 30px; text-align: justify;">b. We use NanoCool, a one-time use refrigeration unit, to ship your breast milk. It is essential that your breast milk is fully refrigerated and that NanoCool has been activated for at least one hour before packing.</p>\r\n<p style="padding-left: 30px; text-align: justify;">c. In addition to providing you with instruction cards as part of our delivery package, we have created an instructional <a href="http://www.milkstork.com/howtopack">How To Pack</a> video.  Do not forget to pack the instruction card on the top of your package so that your caregiver will have immediate access to the instructions upon receipt.</p>\r\n<p style="padding-left: 30px; text-align: justify;">d. It is your responsibility to advise your partner or caregiver to refer to the instruction card so that they use the proper procedures for unpacking NanoCool, inspecting the contents and refrigerating the NUK storage bags. <strong>You also acknowledge that it is your responsibility to instruct your partner or caregiver on the milk temperature standard you adhere to so that they can assess the quality and safety of the breast milk they receive</strong>.</p>\r\n<p style="padding-left: 30px; text-align: justify;">e. Milk Stork is not liable for your failure to follow any instructions provided and any misuse of packaging supplies provided by Milk Stork.</p>\r\n\r\n<ol style="text-align: justify;" start="7">\r\n	<li><strong><span style="text-decoration: underline;">CUSTOMER GUARANTY AND REFUND POLICY</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">Subject to the provisions of Section 13, all of our deliveries are backed by a 100% customer satisfaction guarantee.  If you are dissatisfied with a delivery for any reason, please contact us at <a href="http://www.milkstork.com/contactus">www.milkstork.com/contactus</a> within seven (7) days after the scheduled delivery date, and we will either give you a coupon for a future delivery or credit you the purchase price for the delivery.</p>\r\n\r\n<ol style="text-align: justify;" start="8">\r\n	<li><strong><span style="text-decoration: underline;">COMMUNICATIONS TO US; USER CONTENT</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">Although we encourage you to e-mail us, we do not want you to, and you should not, e-mail us any content that contains confidential information.  Please refer to our Privacy Policy for further information about how we use your information.  With respect to all e-mails you send to us, including but not limited to, feedback, questions, comments, suggestions, and the like, we shall be free to use any ideas, concepts, know-how, or techniques contained in your communications for any purpose whatsoever, including, but not limited to, the development, production and marketing of products and services that incorporate such information, without compensation to you.  By submitting to us suggestions or other feedback regarding our Services (“Feedback”), you agree that we can use and share (but do not have to) that feedback for any purpose without compensation to you.</p>\r\n<p style="text-align: justify;">As noted above, Users may have the ability to post and upload User Content to the Platform.  You expressly acknowledge and agree that once you submit your User Content it will be accessible by others, and that there is no confidentiality or privacy with respect to such User Content, including, without limitation, any personally identifying information that you may make publicly available.  YOU, AND NOT MILK STORK, ARE ENTIRELY RESPONSIBLE FOR ALL THE USER CONTENT THAT YOU UPLOAD, POST, E-MAIL, OR OTHERWISE TRANSMIT VIA THE PLATFORM AND WEBSITE.</p>\r\n<p style="text-align: justify;">You retain all copyrights and other intellectual property rights in and to your own User Content.  To be clear, you own your User Content.  By agreeing to these Terms of Use, you hereby irrevocably grant us and our sublicensees and assignees a non-exclusive, transferable, perpetual, royalty-free, freely sublicensable (through multiple tiers) license to modify, compile, combine with other content, copy, record, synchronize, transmit, translate, format, distribute, publicly display, publicly perform, and otherwise use or exploit (including for profit) any and all of your User Content, your username, the image associated with your username, and all intellectual property and moral rights therein throughout the universe, in each case, by or in any means, methods, media, or technology now known or hereafter devised.  Without limiting the foregoing, you acknowledge and agree that uses of your User Content, username, and associated picture permitted by the foregoing rights and licenses may include the display of such User Content, username, and associated picture adjacent to advertising and other material or content, including for profit.</p>\r\n<p style="text-align: justify;">If you submit User Content to us, each such submission constitutes a representation and warranty to Milk Stork that such User Content is your original creation (or that you otherwise have the right to provide the User Content), that you have the rights necessary to grant the license to the User Content under this Section, and that it and its use by Milk Stork and its content partners as permitted by this Agreement does not and will not infringe or misappropriate the intellectual property, privacy, publicity, or moral rights of any person or contain any libelous, defamatory, or obscene material or content that violates our community guidelines set forth above.</p>\r\n\r\n<ol style="text-align: justify;" start="9">\r\n	<li><strong><span style="text-decoration: underline;">INTELLECTUAL PROPERTY</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">The Platform contains material, such as software, text, graphics, images, sound recordings, audiovisual works, and other material provided by or on behalf of Milk Stork (collectively referred to as the “Content”).  The Content may be owned by us or other third parties.  The Content is protected under both United States and foreign laws.  Unauthorized use of the Content may violate copyright, trademark, and other laws.  You have no rights in or to the Content, other than your own User Content, and you will not use the Content except as permitted under this Agreement.  No other use is permitted without prior written consent from us.  You may not sell, transfer, assign, license, sublicense, or modify the Content or reproduce, display, publicly perform, make a derivative version of, distribute, or otherwise use the Content in any way for any public or commercial purpose.</p>\r\n<p style="text-align: justify;">If you violate any part of this Agreement, your permission to access and/or use the Content, the Website, the Platform, and the Services automatically terminates, and you must immediately destroy any copies you have made of the Content.</p>\r\n<p style="text-align: justify;">The trademarks, service marks, and logos of Milk Stork (the “Milk Stork Trademarks”) used and displayed on the Platform are registered and unregistered trademarks or service marks of Milk Stork.  Other company, product, and service names located on the Platform may be trademarks or service marks owned by others (the “Third-Party Trademarks”, and, collectively with Milk Stork Trademarks, the “Trademarks”).  Nothing in this Agreement should be construed as granting, by implication, estoppel, or otherwise, any license or right to use the Trademarks, without our prior written permission specific for each such use.  Use of the Trademarks as part of a link to or from any site is prohibited unless establishment of such a link is approved in advance by us in writing.  All goodwill generated from the use of Milk Stork Trademarks inures to our benefit.</p>\r\n<p style="text-align: justify;">Elements of the Website and the Platform are protected by trade dress, trademark, unfair competition, and other state, federal, and national laws and may not be copied or imitated, in whole or in part, by any means, including but not limited to the use of framing or mirrors.</p>\r\n\r\n<ol style="text-align: justify;" start="10">\r\n	<li><strong><span style="text-decoration: underline;">DIGITAL MILLENNIUM COPYRIGHT ACT</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">Milk Stork respects the intellectual property rights of others and attempts to comply with all relevant laws. We will review all claims of copyright infringement received and remove any Content deemed to have been posted or distributed in violation of any such laws. Our designated agent under the Digital Millennium Copyright Act (the “DMCA”) for the receipt of any Notification of Claimed Infringement which may be given under the DMCA pursuant to 17 U.S.C. § 512(c) is as follows:</p>\r\n<p style="padding-left: 60px; text-align: justify;">Milk Stork, Inc.\r\nAttention: DMCA\r\n555 Bryant St. #151\r\nPalo Alto, CA 94301</p>\r\n<p style="text-align: justify;">If you believe that your work has been copied on the Website or Platform in a way that constitutes copyright infringement, please provide our agent with notice in accordance with the requirements of the Act, including (i) a description of the copyrighted work that has been infringed and the specific location on the Platform where such work is located; (ii) a description of the location of the original or an authorized copy of the copyrighted work; (iii) your address, telephone number and e-mail address; (iv) a statement by you that you have a good faith belief that the disputed use is not authorized by the copyright owner, its agent or the law; (v) a statement by you, made under penalty of perjury, that the information in your notice is accurate and that you are the copyright owner or authorized to act on the copyright owner’s behalf; and (vi) an electronic or physical signature of the owner of the copyright or the person authorized to act on behalf of the owner of the copyright interest.</p>\r\n<p style="text-align: justify;">You acknowledge and agree that upon receipt of a notice of a claim of copyright infringement, we may immediately remove the identified materials from the Website or Platform without liability to you or any other party and that the claims of the complaining party and the party that originally posted the materials will be referred to the United States Copyright Office for adjudication as provided in the DMCA.</p>\r\n\r\n<ol style="text-align: justify;" start="11">\r\n	<li><strong><span style="text-decoration: underline;">CONFIDENTIAL INFORMATION</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">Any information provided by you to us, or information used by you to access the Website or Platform, including without limitation, any user identification or password to the Website or Platform, (collectively “Confidential Information”) shall be maintained by you as confidential and available exclusively for you as provided in these Terms of Use.  You shall not disclose any Confidential Information to anyone, except as ordered by a court of competent jurisdiction or as otherwise required by law.  You will not disclose any Confidential Information pursuant to a court order or as required by law until you have given us ten (10) days prior written notice and an opportunity to oppose such disclosure.  Notwithstanding the foregoing, you may disclose Content originally submitted by User.</p>\r\n\r\n<ol style="text-align: justify;" start="12">\r\n	<li><strong><span style="text-decoration: underline;">EXTERNAL SITES</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">The Platform may contain links to third-party websites (“External Sites”).  These links are provided solely as a convenience to you and not as an endorsement by us of the content on such External Sites.  The content of such External Sites is developed and provided by others and subject to different terms of use.  It is your responsibility to understand your rights and obligations under those terms of use.  You should contact the site administrator or webmaster for those External Sites if you have any concerns regarding such links or any content located on such External Sites.  We are not responsible for the content of any linked External Sites and do not make any representations regarding the content or accuracy of materials on such External Sites.  You should take precautions when downloading files from all websites to protect your computer from viruses and other destructive programs.  If you decide to access linked External Sites, you do so at your own risk.</p>\r\n\r\n<ol style="text-align: justify;" start="13">\r\n	<li><strong><span style="text-decoration: underline;">WARRANTY DISCLAIMER AND LIMITATION OF LIABILITY</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">YOU, AND NOT MILK STORK, ARE SOLELY RESPONSIBLE FOR THE PROPER AND SAFE WASHING OF BREAST PUMP SUPPLIES AND HANDLING OF BREAST MILK. OTHER THAN AS EXPRESSLY SET FORTH IN <span style="text-decoration: underline;">SECTION 7</span>: (I) WE MAKE NO WARRANTIES OR REPRESENTATIONS ABOUT THE PLATFORM, THE SERVICES, THE QUALITY OF THE BREAST MILK, THE TEMPERATURE OF THE BREAST MILK UPON ARRIVAL, THE NUK UNITS, THE NANOCOOL PACKAGES, THE CONTENTS OF THE NUK UNITS OR NANOCOOL PACKAGING; THE PERFORMANCE OF THE NANOCOOL PACKAGING, THE CONTENT, THE TRADEMARKS, THE SERVICES, THE PRODUCTS ON THE WEBSITE AND THE PLATFORM, AND ALL OF THE FOREGOING ARE PROVIDED ON AN “AS IS” AND “AS AVAILABLE” BASIS WITHOUT ANY WARRANTIES OF ANY KIND; (II) WE DISCLAIM ALL WARRANTIES, INCLUDING, BUT NOT LIMITED TO, WARRANTIES OF MERCHANTABILITY, NON-INFRINGEMENT OF THIRD PARTIES’ RIGHTS, AND FITNESS FOR PARTICULAR PURPOSE AND ANY WARRANTIES ARISING FROM COURSE OF DEALING, COURSE OF PERFORMANCE, OR USAGE OF TRADE; AND (III) YOU AGREE THAT YOU USE THE PLATFORM AND THE SERVICES AT YOUR OWN RISK.</p>\r\n<p style="text-align: justify;">IN NO EVENT SHALL WE BE LIABLE FOR ANY INCIDENTAL AND CONSEQUENTIAL DAMAGES, LOST PROFITS, OR DAMAGES RESULTING FROM LOST DATA OR BUSINESS INTERRUPTION) RESULTING FROM YOUR PURCHASE OF THE SERVICE OR YOUR USE OR INABILITY TO USE THE PLATFORM OR THE SERVICES, WHETHER BASED ON WARRANTY, CONTRACT, TORT (INCLUDING NEGLIGENCE), OR ANY OTHER LEGAL THEORY, EVEN IF WE HAVE BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES.  SOME STATES DO NOT ALLOW EXCLUSION OF IMPLIED WARRANTIES OR LIMITATION OF LIABILITY FOR INCIDENTAL OR CONSEQUENTIAL DAMAGES, SO THE ABOVE LIMITATIONS OR EXCLUSIONS MAY NOT APPLY TO YOU.  IN SUCH CASES, OUR LIABILITY SHALL BE LIMITED TO THE GREATEST EXTENT PERMITTED BY LAW.  IN ALL CASES, OUR MAXIMUM LIABILITY TO YOU (AND ANYONE CLAIMING RIGHTS THROUGH YOU) SHALL BE CAPPED AT THE MONIES PAID BY YOU TO MILK STORK FOR THE ONE (1) DELIVERY PRECEDING THE DATE ON WHICH YOUR CLAIM AROSE.</p>\r\n<p style="text-align: justify;">MILK STORK HAS MADE EVERY EFFORT TO DISPLAY ITS SERVICES AND OTHER THINGS YOU SEE ON THE PLATFORM AS ACCURATELY AS POSSIBLE.  THE PLATFORM MAY CONTAIN TECHNICAL INACCURACIES OR TYPOGRAPHICAL ERRORS OR OMISSIONS. WE ARE NOT RESPONSIBLE FOR ANY SUCH TYPOGRAPHICAL, TECHNICAL, OR PRICING ERRORS.</p>\r\n\r\n<ol style="text-align: justify;" start="14">\r\n	<li><strong><span style="text-decoration: underline;">INJUNCTION</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">The Company and User agree that a breach or violation of these Terms of Use will result in immediate and irreparable injury and harm to Milk Stork.  In such event, we shall have, in addition to any and all remedies of law and other consequences under these Terms of Use, the right to an injunction, specific performance or other equitable relief to prevent the violation of the obligation under these Terms of Use; provided, however, that, this shall in no way limit any other remedies which we may have, including, without limitation, the right to seek monetary damages.</p>\r\n\r\n<ol style="text-align: justify;" start="15">\r\n	<li><strong><span style="text-decoration: underline;">INDEMNIFICATION</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">You agree to defend, indemnify, and hold us and our officers, directors, employees, successors, licensees, and assigns harmless from and against any claims, actions, or demands, including, without limitation, reasonable legal and accounting fees, arising or resulting from your breach of this Agreement or your access to, use, or misuse of the Platform or the Services.  We shall provide notice to you of any such claim, suit, or proceeding and shall assist you, at your expense, in defending any such claim, suit, or proceeding.  We reserve the right to assume the exclusive defense and control of any matter that is subject to indemnification under this section.  In such case, you agree to cooperate with any reasonable requests assisting our defense of such matter.</p>\r\n\r\n<ol style="text-align: justify;" start="16">\r\n	<li><strong><span style="text-decoration: underline;">COMPLIANCE WITH APPLICABLE LAWS</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">The Website and the Services (and their servers) are all based and operated in the United States.  We make no claims concerning whether the Content may be downloaded, viewed, or be appropriate for use outside of the United States.  If you access the Website, the Services, the Platform, or the Content from outside of the United States, you do so at your own risk.  Whether inside or outside of the United States, you are solely responsible for ensuring compliance with the laws of your specific jurisdiction.</p>\r\n\r\n<ol style="text-align: justify;" start="17">\r\n	<li><strong><span style="text-decoration: underline;">TERMINATION OF THE AGREEMENT</span></strong></li>\r\n</ol>\r\n<p style="text-align: justify;">We reserve the right, in our sole discretion, to restrict, suspend, or terminate this Agreement and your access to all or any part of the Website or the Services, at any time and for any reason without prior notice or liability.  We reserve the right to change, suspend, or discontinue all or any part of the Website or the Services at any time without prior notice or liability.</p>\r\n<p style="text-align: justify;">Without limiting the generality of the last paragraph, if we have reason to believe that you have engaged in any of the prohibited or unauthorized activities described in these Terms or have otherwise breached your obligations under these Terms, we may: (i) terminate, suspend or limit your access to or use of the Website or Services; (ii) notify law enforcement, regulatory authorities, impacted third parties and others as we deem appropriate; (iii) refuse to provide Services to you in the future; and (iv) take legal action against you.  Upon termination of User’s license granted in these Terms of Use, User agrees to immediately destroy any printouts or copies of the Website in User’s possession or under User’s control, and all licenses granted and all services provided to User under these Terms of Use shall terminate.</p>\r\n\r\n<ol style="text-align: justify;" start="18">\r\n	<li><strong><span style="text-decoration: underline;">CHANGES TO TERMS OF USE</span></strong></li>\r\n</ol>\r\n<