nderstanding between the parties; and (iii) may not be amended except in writing signed by the Company and User.</p>\r\n<p style="padding-left: 30px; text-align: justify;">h. <span style="text-decoration: underline;">No Assignment.</span> User agrees that the license granted in these Terms of Use is personal to User, and User may not assign or transfer any license granted under these Terms of Use, or transfer any rights or delegate any duties under these Terms of Use, to any third party.  Any attempt to assign, transfer, or delegate any of User’s rights, duties, or obligations under these Terms of Use shall be void.</p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;">4847-7926-7361, v.  5</p>'),
